var findTheDifference = function(s, t) {
    
 let sHash = {};
 let tHash = {};

 for (let i = 0; i < s.length; i++) {
  let sChar = s[i];
  let tChar = t[i];

  if (!sHash[sChar]) {
   sHash[sChar] = 1
  } else {
   sHash[sChar]++
  }
  
  if (!tHash[tChar]) {
   tHash[tChar] = 1
  } else {
   tHash[tChar]++
  }
 }

 let tChar = t[t.length -1];
 if (!tHash[tChar]) {
  tHash[tChar] = 1
 } else {
  tHash[tChar]++
 }
 
 console.log(sHash, tHash)

 for (let key in tHash) {
  if (tHash[key] !== sHash[key]) return key;
 }
};

function testFindTheDifference() {

 let testCases = [
  {arg: ["",
  ""], expected: "t"},
  {arg: ["abcd", "abcde"], expected: "e"},
  {arg: ["", "y"], expected: "y"},
  
 ]
 

 testCases.forEach(test => {
  let result = findTheDifference(test.arg[0], test.arg[1]);

  let passed = result === test.expected;
  
   if (passed) {
    status = "Passed"
   } else status = "Failed"
   console.log( `${status}. ${test.arg} produced ${result} and the expected was ${test.expected}`)
  
 })
}

testFindTheDifference();